import React, {Component} from 'react';
export default class Group extends Component {
    render(){
        return (
            <div className='border-left centering t-18 line-h-md'>
                <div className='padding-lg'>
                    <div className='section-title t-24'>Affiliated groups</div>
                    <div className='l-apple-box-half'></div>
                    <div className='text'>Human Data Interaction group</div>
                    <div className='text'>Human Computer Interaction Lab</div>
                    <div className='text'>Bohyemian Lab</div>
                </div>
            </div>
        )
    }
}
